import React from 'react'

interface CardProps {
    width?: string;
    height?: string;
    children?: React.ReactChild | React.ReactNode;
}

export const Card = ({ width, height, children }: CardProps) => {
    return (
        <div style={{ width, height, border: '1px solid gray' }}>
            {children}
        </div>
    )
}
